import { GET_USER } from "../actions/user.actions";

const initialState = {};

export default function userReducer (State = initialState, action) {
    switch (action.type) {
        case GET_USER:
            // toute la data qui a été envoyé , on incremente 
            return action.payload

        default:
            return state
    }
